import React from 'react';

function GitLab() {
  return(
    <a href="https://gitlab.com/cae07">
      <img
        alt="GitLab do Caê Calçolari"
        height="50"
        width="180"
        src="https://img.shields.io/badge/GitLab-330F63?style=for-the-badge&logo=gitlab&logoColor=white"
        target="_blank"
      />
    </a>
  );
}

export default GitLab;
